import { useState } from 'react';
import { Link } from 'react-router-dom';
import Header from '../components/Header';

export default function Admin() {
  const [title, setTitle] = useState('');
  const [desc, setDesc] = useState('');
  const [questions, setQuestions] = useState([{ text: '', options: ['', '', '', ''], correct: 0 }]);

  const addQuestion = () => {
    setQuestions([...questions, { text: '', options: ['', '', '', ''], correct: 0 }]);
  };

  const updateQuestion = (index, field, value) => {
    const newQuestions = [...questions];
    newQuestions[index][field] = value;
    setQuestions(newQuestions);
  };

  const updateOption = (qIndex, oIndex, value) => {
    const newQuestions = [...questions];
    newQuestions[qIndex].options[oIndex] = value;
    setQuestions(newQuestions);
  };

  const saveQuiz = () => {
    const quiz = { title, desc, questions };
    console.log('Сохранённый квиз:', quiz);
    alert('Викторина сохранена в консоли (позже отправится на бэкенд)');
  };

  return (
    <>
      <Header />
      <div className="container">
        <h1 style={{ fontSize: '28px', color: '#2d3748', marginBottom: '20px' }}>Админ-панель</h1>
        <p>Создайте новую викторину</p>

        <div style={{ marginBottom: '20px' }}>
          <label>Название</label>
          <input
            type="text"
            className="input"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            placeholder="Например: История двигателестроения"
            style={{ marginTop: '8px', width: '100%' }}
          />
        </div>

        <div style={{ marginBottom: '20px' }}>
          <label>Описание</label>
          <textarea
            type="text"
            className="input"
            rows="3"
            value={desc}
            onChange={(e) => setDesc(e.target.value)}
            placeholder="Краткое описание..."
            style={{ marginTop: '8px', width: '100%' }}
          />
        </div>

        <button onClick={addQuestion} className="btn" style={{ marginBottom: '20px' }}>
          + Добавить вопрос
        </button>

        {questions.map((q, qIndex) => (
          <div key={qIndex} style={{
            background: '#f8f9fa',
            padding: '20px',
            borderRadius: '12px',
            border: '1px solid #e2e8f0',
            marginBottom: '15px'
          }}>
            <h4>Вопрос {qIndex + 1}</h4>
            <input
              type="text"
              className="input"
              value={q.text}
              onChange={(e) => updateQuestion(qIndex, 'text', e.target.value)}
              placeholder="Текст вопроса"
              style={{ marginBottom: '10px', width: '100%' }}
            />
            {q.options.map((opt, oIndex) => (
              <div key={oIndex} style={{ display: 'flex', alignItems: 'center', marginBottom: '8px' }}>
                <input
                  type="radio"
                  name={`correct-${qIndex}`}
                  checked={q.correct === oIndex}
                  onChange={() => updateQuestion(qIndex, 'correct', oIndex)}
                  style={{ marginRight: '10px' }}
                />
                <input
                  type="text"
                  className="input"
                  value={opt}
                  onChange={(e) => updateOption(qIndex, oIndex, e.target.value)}
                  placeholder={`Вариант ${oIndex + 1}`}
                  style={{ flex: 1 }}
                />
              </div>
            ))}
          </div>
        ))}

        <button onClick={saveQuiz} className="btn" style={{ width: '100%' }}>
          Сохранить викторину
        </button>

        <div style={{ marginTop: '20px' }}>
          <Link to="/main" className="btn" style={{ background: '#718096' }}>Назад</Link>
        </div>
      </div>
    </>
  );
}
